import React from "react";
import ExportExcel from "react-export-excel";

export default ({}) => {
  const ExcelFile = ExportExcel.ExcelFile;
  const ExcelSheet = ExportExcel.ExcelSheet;
  const ExcelColumn = ExportExcel.ExcelColumn;

  const userData = [
    {
      name: "Johson",
      amount: 30000,
      sex: "M",
      is_married: true,
    },
    {
      name: "Monika",
      amount: 355000,
      sex: "F",
      is_married: false,
    },
    {
      name: "John",
      amount: 250000,
      sex: "M",
      is_married: false,
    },
    {
      name: "Josef",
      amount: 450500,
      sex: "M",
      is_married: true,
    },
  ];
  return (
    <div>
      <ExcelFile
        element={<button>Exportar a Excel</button>}
        filename="facturas_socios"
      >
        <ExcelSheet data={userData} name="Detalle de facturas">
          <ExcelColumn label="Nombres" value="fullName" />
          <ExcelColumn label="Apellidos" value="lastName" />
        </ExcelSheet>
      </ExcelFile>
    </div>
  );
};
